const MyContext = react.createContext();

const TaskState=(props)=>{
    const tasks=[
        {
            "_id":"8272820",
            "user":"5e6288",
            "task":"hello"
        },
        {
            "_id":"8272820",
            "user":"5e6288",
            "task":"hi"
        },
        {
            "_id":"8272820",
            "user":"5e6288",
            "task":"bedtime"
        },
        {
            "_id":"8272820",
            "user":"5e6288",
            "task":"hello"
        },
    ]
    const [state,setstate]=useState(tasks)
    return(
        <MyContext.Provider value={{state,setstate}}>
            {props.children}
        </MyContext.Provider>
    )

}

export default TaskState;
